import React, { useState } from 'react';
import './CardList.css';
import CardItem from './CardItem';

function CardList() {
  const [filters, setFilters] = useState([]);

  const handleFilterChange = (filter) => {
    if (filters.includes(filter)) {
      setFilters(filters.filter((f) => f !== filter));
    } else {
      setFilters([...filters, filter]);
    }
  };

  const cardItems = [
    // Card items data
  ];

  const filteredItems = cardItems.filter((item) => {
    if (filters.length === 0) {
      return true;
    }

    const hasTextFilter = filters.includes('text');
    const hasImageFilter = filters.includes('image');
    const hasFreeFilter = filters.includes('free');
    const hasPaidFilter = filters.includes('paid');

    if (
      hasTextFilter &&
      hasImageFilter &&
      hasFreeFilter &&
      hasPaidFilter
    ) {
      return true;
    }

    if (
      hasTextFilter &&
      !hasImageFilter &&
      !hasFreeFilter &&
      !hasPaidFilter
    ) {
      return item.type === 'text';
    }

    if (
      hasTextFilter &&
      hasImageFilter &&
      !hasFreeFilter &&
      !hasPaidFilter
    ) {
      return item.type === 'text' || item.type === 'image';
    }

    if (
      hasTextFilter &&
      !hasImageFilter &&
      hasFreeFilter &&
      !hasPaidFilter
    ) {
      return item.type === 'text' && item.price === 'free';
    }

    if (
      !hasTextFilter &&
      hasImageFilter &&
      !hasFreeFilter &&
      !hasPaidFilter
    ) {
      return item.type === 'image';
    }

    if (
      !hasTextFilter &&
      hasImageFilter &&
      hasFreeFilter &&
      !hasPaidFilter
    ) {
      return item.type === 'image' && item.price === 'free';
    }

    if (
      !hasTextFilter &&
      !hasImageFilter &&
      hasFreeFilter &&
      !hasPaidFilter
    ) {
      return item.price === 'free';
    }

    if (
      !hasTextFilter &&
      !hasImageFilter &&
      !hasFreeFilter &&
      hasPaidFilter
    ) {
      return item.price === 'paid';
    }

    if (
      hasTextFilter &&
      hasImageFilter &&
      !hasFreeFilter &&
      hasPaidFilter
    ) {
      return (
        (item.type === 'text' || item.type === 'image') &&
        item.price === 'paid'
      );
    }

    if (
      hasTextFilter &&
      !hasImageFilter &&
      !hasFreeFilter &&
      hasPaidFilter
    ) {
      return item.type === 'text' && item.price === 'paid';
    }

    if (
      hasTextFilter &&
      !hasImageFilter &&
      hasFreeFilter &&
      !hasPaidFilter
    ) {
      return item.type === 'text' && item.price === 'free';
    }

    if (
      !hasTextFilter &&
      hasImageFilter &&
      !hasFreeFilter &&
      hasPaidFilter
    ) {
      return item.type === 'image' && item.price === 'paid';
    }

    if (
      hasTextFilter &&
      !hasImageFilter &&
      hasFreeFilter &&
      hasPaidFilter
    ) {
      return (
        (item.type === 'text' || item.type === 'image') &&
        item.price === 'free'
      );
    }

    if (
      hasTextFilter &&
      hasImageFilter &&
      hasFreeFilter &&
      !hasPaidFilter
    ) {
      return (
        (item.type === 'text' || item.type === 'image') &&
        item.price === 'free'
      );
    }

    if (
      !hasTextFilter &&
      !hasImageFilter &&
      hasFreeFilter &&
      hasPaidFilter
    ) {
      return item.price === 'free' || item.price === 'paid';
    }

    if (
      hasTextFilter &&
      !hasImageFilter &&
      hasFreeFilter &&
      hasPaidFilter
    ) {
      return (
        (item.type === 'text' || item.type === 'image') &&
        (item.price === 'free' || item.price === 'paid')
      );
    }

    return false;
  });

  return (
    <div className='card-list'>
      <h1>Card List</h1>
      <div className='filter-buttons'>
        <label>
          <input
            type='checkbox'
            checked={filters.includes('text')}
            onChange={() => handleFilterChange('text')}
          />
          Text
        </label>
        <label>
          <input
            type='checkbox'
            checked={filters.includes('image')}
            onChange={() => handleFilterChange('image')}
          />
          Image
        </label>
        <label>
          <input
            type='checkbox'
            checked={filters.includes('free')}
            onChange={() => handleFilterChange('free')}
          />
          Free
        </label>
        <label>
          <input
            type='checkbox'
            checked={filters.includes('paid')}
            onChange={() => handleFilterChange('paid')}
          />
          Paid
        </label>
      </div>
      <div className='card-grid'>
        {filteredItems.map((card, index) => (
          <CardItem key={index} src={card.src} text={card.text} url={card.url} />
        ))}
      </div>
    </div>
  );
}

export default CardList;
